export default class extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            visible: this.props.visible
        }
    }

    render() {
        return (
            <>
                <div className="sidenav">
                    <a href="javascript:void(0)" className="closebtn" onclick="">&times;</a>
                    <a href="#"></a>
                    <a href="#">Services</a>
                    <a href="#">Clients</a>
                    <a href="#">Contact</a>
                </div>

                <button type='button' onClick={() => {
                    this.setState({visible: !this.state.visible})
                }}>
                            <i class="fa fa-bars"></i>
                        </button>
                <style jsx>{`

            button{
                color: gray;
                font-size: 1.3rem;
                background: transparent;
                border: none;
            }

            .sidenav {
                height: 100%;
                width: 0;
                position: fixed;
                z-index: 1;
                top: 0;
                left: 0;
                background-color: #111;
                overflow-x: hidden;
                transition: 0.5s;
                padding-top: 60px;
              }

            .sidenav a {
                padding: 8px 8px 8px 32px;
                text-decoration: none;
                font-size: 25px;
                color: #818181;
                display: block;
                transition: 0.3s;
              }

              .sidenav a:hover {
                color: #f1f1f1;
              }

              .sidenav .closebtn {
                position: absolute;
                top: 0;
                right: 25px;
                font-size: 36px;
                margin-left: 50px;
              }
        `}</style>
            </>
        );
    }
}
